import "./WalletConnectForm.css";

const WalletConnectForm = () => {
  return (
    <div className="frame18">
      <div className="divcards-parent">
        <div className="divcards5" />
        <div className="divcards6">
          <div className="connect-your-wallet">Connect your wallet</div>
        </div>
        <div className="divcards7">
          <div className="connect-your-wallet">
            Run Planck in the background
          </div>
        </div>
        <div className="divcards8">
          <div className="connect-your-wallet">Earn $PLN tokens</div>
        </div>
        <div className="download-the-installer">Download the installer</div>
      </div>
    </div>
  );
};

export default WalletConnectForm;
